import 'D:/capstone-frontend/my-app/my-app/src/App.css';
import { Table } from '../tabledata/AccountsTable';
import {ImportExcelButton} from 'D:/capstone-frontend/my-app/my-app/src/components/button/ImportExcelButton';
import ComponentPopup from 'D:/capstone-frontend/my-app/my-app/src/components/Popups/AccountPopup'

function Accounts() {
  const [addAccountBtn, setaddAccountBtn] = useState(false);
  return (
    <>
    <ImportExcelButton  type="button"
    onClick={() => {
      setaddAccountBtn(true)}
      }>Add Account</ImportExcelButton>
          <ComponentPopup trigger={addAccountBtn} setTrigger={setaddAccountBtn}>
      <h3>Account Popup</h3>
    </ComponentPopup>
    <div className='accounts'>
    <Table/></div></>
  )
}

export default Accounts
